import styled from 'styled-components'

const Div = styled.div`
    border-style: solid;
    width: 10em;
    margin: 1em;

`;

const Counter = ( { title='TITLE', endpoint } ) => {
    return (
        <Div>
            <h1>{title}</h1>
            <h1>0000</h1>
        </Div>
    )
}

export default Counter
